import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { Observable } from 'rxjs';
import { AddUserRequest } from '../appmodels/adduser.model';



export class UserService {

  constructor(private httpClient: HttpClient) {

  }

  addUser1(addCategoryrequest: AddUserRequest): Observable<void> {
    return this.httpClient.post<void>("https://localhost:7159/api/user", addCategoryrequest);
  }

  addUser(addCategoryrequest: AddUserRequest): Observable<void> {
    return this.httpClient.post<void>("https://localhost:7244/UserInfo", addCategoryrequest);
  }
  GetUser(): Observable<string> {
    return this.httpClient.get<string>("https://localhost:7159/api/user");
  }
}
